@Override
public int hashCode() {
  int result;
  long temp;
  result = x1.hashCode();
  result = 31 * result + y1.hashCode();
  result = 31 * result + x2.hashCode();
  result = 31 * result + y2.hashCode();
  result = 31 * result + name().hashCode();
  temp = radius != +0.0d ? Double.doubleToLongBits(radius) : 0L;
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  return result;
}

